import React from 'react';
import ReactDom from 'react-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import Data from './data.json';

const App = () => {

  return(
      <div className="container">
          { Data.map(post =>{
            return(
              <div key={ post.id } className="post">

              </div>
            )
          })}
      </div>
  )
}

export default App;
